import React from 'react';
import { ContainerPai, TituloPrincipal } from './style'
import logoLabenu from 'ex-styled-components\src\components\Logo\logoLabenujpg.jpg'

function Header() {
    return (

        <ContainerPai>
        <img src={logoLabenu} alt='Logo da Labenu'/>
            <p>Logo</p>
            <TituloPrincipal>LabZap/ WhatsLab</TituloPrincipal>
        </ContainerPai>
    ) 
}

export default Header;
